            var instances = M.Carousel.init(elems, {});
          });
    }

    render() {
        return (
            <div>
                <div className="carousel">
                    <a className="carousel-item" href="#one!"><img src="https://www.zecanka.com/img/kategorije/trpezarije.jpg" /></a>
